		if(_allDataRetrieved()) return;

		// Wait 1 second to load data
		_update_timer += Time.deltaTime;
		if (_update_timer > 1.0f) {
			_loadAccountsJson();
			_loadBudgetsJson();
			// _loadCategoriesJson();
			// _loadMembersJson();
			_loadTransactionsJson();
		}
	}

